var levels = [];
var lastCarPosY = 0;
for (let lev of levelDesigner) {
  var ArrayOfObjs = [];
  for (let car of lev.objs) {
    switch (car.type) {
      case "car":
        ArrayOfObjs.push(
          new Car({
            id: car.id,
            parentId: car.parentId,
            pos: [car.pos[0], -car.pos[1]],
            color: "yellow",
            vel: [0, 0.2],
          })
        );
        if (lastCarPosY > -car.pos[1]) lastCarPosY = -car.pos[1];
        break;
      case "AutoCar":
        ArrayOfObjs.push(
          new Car(
            {
              id: car.id,
              parentId: car.parentId,
              pos: [car.pos[0], -car.pos[1]],
              color: "yellow",
              vel: [0, 0.2],
            },
            car.type
          )
        );
        if (lastCarPosY > -car.pos[1]) lastCarPosY = -car.pos[1];
        break;
      case "ChildCar":
        ArrayOfObjs.push(
          new Car(
            {
              id: car.id,
              parentId: car.parentId,
              pos: [car.pos[0], -car.pos[1]],
              color: "yellow",
              vel: [0, 0.2],
            },
            car.type
          )
        );
        if (lastCarPosY > -car.pos[1]) lastCarPosY = -car.pos[1];
        break;
      case "CrazyCar":
        ArrayOfObjs.push(
          new Car(
            {
              id: car.id,
              parentId: car.parentId,
              pos: [car.pos[0], -car.pos[1]],
              color: "yellow",
              vel: [0, 0.2],
            },
            car.type
          )
        );
        if (lastCarPosY > -car.pos[1]) lastCarPosY = -car.pos[1];
        break;
      case "Player":
        ArrayOfObjs.push(
          new Player({
            pos: [car.pos[0], -car.pos[1]],
            color: "yellow",
            vel: [0, 0.2],
          })
        );

        break;
      case "invisible":
        ArrayOfObjs.push(
          new Invisible({
            id: car.id,
            pos: [car.pos[0], -car.pos[1]],
          })
        );

        break;
      case "boost":
        ArrayOfObjs.push(
          new Power({
            id: car.id,
            pos: [car.pos[0], -car.pos[1]],
          })
        );

        break;
      case "Fuel":
        ArrayOfObjs.push(
          new Fuel({
            id: car.id,
            pos: [car.pos[0], -car.pos[1] - 60],
          })
        );

        break;

      case "Bomb":
        ArrayOfObjs.push(
          new Bomb({
            id: car.id,
            pos: [car.pos[0], -car.pos[1]],
          })
        );

        break;
      case "goal":
        ArrayOfObjs.push(
          new Goal({
            pos: [0, -car.pos[1]],
            size: [lev.width, 50],
            color: "yellow",
            vel: [0, 0.2],
          })
        );
      default:
        break;
    }
  }
  const checkIfGoalExists = ArrayOfObjs.find((obj) => {
    return obj.type === "Goal";
  });
  if (!checkIfGoalExists) {
    ArrayOfObjs.push(
      new Goal({
        pos: [0, lastCarPosY - 300],
        size: [lev.width, 50],
        color: "yellow",
        vel: [0, 0.2],
      })
    );
  }
  ArrayOfObjs.push(
    new Player({
      pos: [320, 400],
      color: "red",
    })
  );

  levels.push(new Level(ArrayOfObjs, [lev.width, 800], lev.backGroundImage));
}

export const Alllevels = levels;
